prompt:
Your task is to evaluate the precision of a generated system model. You will be given a reference system model and a generated system model. Please perform the following steps:

1. List all atomic modeling claims made by the generated system model. Each atomic claim should correspond to a minimal, meaningful modeling element (e.g., the definition of a part, the declaration of an attribute, the use of types, or structural relations like containment or reference).
2. For each atomic claim in the generated model, determine whether it is supported by the reference model (i.e., the reference model contains the same or equivalent element).
3. Summarize the results using the format: Score: <number of supported claims>/<total number of claims in the generated model>

You should IGNORE formatting or identifier NAMING differences if the structure and semantics match.

Input:
Reference Model:
package 'VehicleFuelSystem' {
	part def Vehicle;
	part def FuelPump;
	part def FuelTank;
	attribute def Temp;
	part def Fuel;
	port def FuelOutPort {
		attribute temperature : Temp;
		out item fuelSupply : Fuel;
		in item fuelReturn : Fuel;
	}
	part def FuelTankAssembly {
		port fuelTankPort : FuelOutPort;
	}
	part vehicle : Vehicle {	
		part tank : FuelTankAssembly {
			port redefines fuelTankPort {
				out item redefines fuelSupply;
				in item redefines fuelReturn;
			}
			part pump : FuelPump {
				out item pumpOut : Fuel = fuelTankPort.fuelSupply;
				in item pumpIn : Fuel;
			}
			part tank : FuelTank {
				out item fuelOut : Fuel;
				in item fuelIn : Fuel = fuelTankPort.fuelReturn;
			}
		}
	} 
}

Generated Model:
package 'AutomotiveFuelCirculationSystem' {
	attribute def FuelTemperature;
	part def Fuel;
	port def FuelOutletPort {
		attribute temperature : FuelTemperature;
		out item deliveredFuel : Fuel;
		in item returnedFuel : Fuel;
	}
	port def FuelInletPort {
		attribute temperature : FuelTemperature;
		in item deliveredFuel : Fuel;
		out item returnedFuel : Fuel;
	}
	part def FuelTank;
	part def FuelPump {
		port pumpPort : FuelOutletPort;
	}
	part def FuelTankAssembly {
		part fuelTank : FuelTank;
		part fuelPump : FuelPump;
		port outletPort : FuelOutletPort;
	}
	part def Engine {
		port fuelPort : FuelInletPort;
	}
	flow def FuelCirculation {
		ref :>> payload : Fuel;
		end port supplier : FuelOutletPort;
		end port consumer : FuelInletPort;
	}
	part def AutomotiveFuelSystem {
		part fuelTankAssembly : FuelTankAssembly;
		part engine : Engine;
		flow : FuelCirculation
		  from fuelTankAssembly.outletPort.deliveredFuel
			to engine.fuelPort.deliveredFuel;
		flow : FuelCirculation
		  from engine.fuelPort.returnedFuel
			to fuelTankAssembly.outletPort.returnedFuel;
		flow : FuelCirculation
		  from fuelTankAssembly.fuelPump.pumpPort.deliveredFuel
			to engine.fuelPort.deliveredFuel;
	}
}


